    if (!match) {
        return <div>Error: Product not found</div>;
    }

    const { id } = match.params;

    // Здесь можно использовать id для загрузки данных о товаре

    return (
        <div>
            <h2>Product Details</h2>
            <p>Product ID: {id}</p>
            {/* Дополнительные детали товара */}
        </div>
    );
}
